import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class Make extends Component {


  render() {
    const { make, handleSelect } = this.props
    return (

        <div className="button-div">
          <button name="make" value={make} onClick={(e) => handleSelect(make)}>{make}</button>
        </div>

    );
  }

}

export default Make;
